import { combineReducers } from 'redux';
import roomsReducer from './rooms';
import virtualReducer from './devices';
import devicesReducer from '../tasmota/reducers';

export default combineReducers({
    roomsReducer,
    virtualReducer,
    devices: devicesReducer,
});
